import React from "react";
//Import Components
import Todo from "./Todo";
const TodoList = ({ todos, setTodos }) => {
    return(
        //Parent component
        <div className="todo-container">
        <ul className="todo-list">
            {todos.map((todo) => (
                <Todo
                    setTodos={setTodos}
                    todos={todos}
                    key={todo.id}
                    todo={todo}
                    text={todo.text}
                    id={todo.id}
                />
            ))}
        </ul>
      </div>
    );
};

export default TodoList;
